import React from 'react'


const attributes = {
    strength: '0',
    constitution: 0,
    dexterity: 0
}

class Hero extends React.Component {
    render() {
        const str = this.props.str;
        return (
            <div>
                <p> Strength: {attributes[str]}</p>
            </div>
        );
    }
}

export default Hero;
